INSERT INTO `information` VALUES (1,'Täby FK bedriver verksamhet för ca 2400 medlemmar från knatte till senior. Tibblevallen som huvudarena och Stockholms nordöstra region som målgrupp.Täby FK:s verksamhet bygger på engagerade ledare och föräldrar som gör ett fantastiskt arbete med att inspirera, skapa gemenskap och utbilda i enlighet med klubbens utbildningsplan. Som spelare i Täby FK ingår du i en stor fotbollsfamilj där spelare utvecklas utifrån sin kunskap- och ambitionsnivå. Som spelare är ambitionen att göra sitt bästa och viljan att utvecklas den största talangen för att bli en bra fotbollsspelare. ','I Täby FKs egna applikation hittar du som medlem erbjudanden från våra nya Guldpartners. Detta är ett steg i att skapa långsiktiga samarbetspartners som tillsammans med oss som klubb vill bidra till att uppnå vårt absolut viktigaste mål, att öka förutsättningarna för ungdomar i Täby. Du som medlem gynnas av detta då du förutom en bättre verksamhet får exklusiva erbjudanden från olika branscher. Detta hoppas vi ska förhöja upplevelsen av att vara medlem i Täby FK och bidra till utveckling över tid för såväl klubb som individ.\r\n','0000-00-00 00:00:00','2016-04-11 16:15:24');
