INSERT INTO `offers` VALUES (16,18,'Gratis pizza','Som startskott på vårt samarbete med Täby FK bjuder vi dig som medlem på en valfri pizza (erbjudandet gäller måndag-torsdag). Välkommen / Pomodorini, Integrale','2017-04-07',1,'Pizza.png','2015-12-17 15:17:44','2016-04-09 12:28:23'),(38,14,'Gratis hårvax','Som ett startskott på vårt utökade samarbete med Täby FK ger vi dig som medlem en gratis vaxburk till ett värde av 200:- (Gäller utvalt REF-vax). Välkommen/ Walléns frisörer, Täby C (bredvid Stadium)','2017-04-07',1,'Vax0.png','2016-01-18 17:33:11','2016-04-08 23:49:13'),(44,33,'Gratis knivslipning','Knivbrev bjuder på slipning av 1 kniv. Välkommen in!\r\nKnivbrev AB är ett av Europas största professionella sliperier. För mer information se www.Knivbrev.se/tabyfk','2017-04-07',1,'kniv5.png','2016-02-10 18:07:30','2016-04-06 14:26:52'),(51,37,'Gratis pensel','Som ett startskott på vårt samarbete med Täby FK bjuder vi dig som medlem på en gratis pensel. Välkommen/ Täby Färg och Tapet','2017-04-07',1,'pensel.png','2016-03-17 12:23:46','2016-04-06 14:28:54'),(52,15,'Gratis fordonskontroll','Som ett startskott på vårt samarbete med Täby FK bjuder vi dig som medlem på en gratis fordonskontroll. Välkommen in/ Bestdrive, Täby','2017-04-07',1,'kontroll1.png','2016-03-17 12:31:23','2016-04-08 22:04:12'),(53,20,'Gratis synundersökning','Nu kan du som medlem göra en gratis synundersökning hos oss. Välkommen in/ Specsavers, Täby C','2017-04-07',1,'synunder1.png','2016-03-17 13:44:51','2016-04-06 14:30:22'),(54,7,'Två timmar med vår köksinredare','Som ett startskott på vårt samarbete med Täby FK bjuder vi dig som medlem på ett gratis möte (2 h) med en utav våra köksinredare. Välkommen att kontakta oss för mer information/ Puustelli, Täby','2017-04-07',1,'inredare.png','2016-03-17 17:51:49','2016-04-06 14:31:34'),(55,7,'50% på bänkskivor/vitvaror/montering','Vid köp av kök får du som medlem i Täby FK 50% rabatt på något av följande alternativ:\r\n- Bänkskivor sten, trä eller lam